import React,{Component, useState} from 'react';
import {Rnd} from 'react-rnd';
import axios from 'axios';
import TextList from './builder/TextList';
import g from 'react-scale-text';
import NavBar from './components/NavBar';
import Blocks from './blocks/blocks'
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import ImageList from './builder/ImageList'
import SvgList from './builder/SvgList'
import PixabaySearch from './assets/Asset-Load';

import './App.css';

import MainMenu from './menu/MainMenu';


const App = () => {
  return (
    <div className="app-container">
      <Routes>
        <Route path="/save-load">
          <div>
            <h2>Save/Load</h2>
            {/* Insert Save/Load components here */}
          </div>
        </Route>
        <Route path="/components">
          <div>
            <h2>Components</h2>
            {/* Insert Components components here */}
          </div>
        </Route>
        <Route path="/assets">
          <div>
            <h2>Assets</h2>
            <PixabaySearch />
          </div>
        </Route>
        <Route path="/databases">
          <div>
            <h2>Databases</h2>
            {/* Insert Databases components here */}
          </div>
        </Route>
        <Route path="/graphics">
          <div>
            <h2>Graphics</h2>
            {/* Insert Graphics components here */}
          </div>
        </Route>
        <Route path="/analytics">
          <div>
            <h2>Analytics</h2>
            {/* Insert Analytics components here */}
          </div>
        </Route>
        <Route path="/sign-out">
          <div>
            <h2>Sign Out</h2>
            {/* Insert Sign Out components here */}
          </div>
        </Route>
      </Routes>
    </div>
  );
};
export default App;
